import React from "react";

function Note(props) {
  return (
    props.items.map((item,index) =>{return(
      <div className="note" key={index}>
      <h1>{item.title}</h1>
      <p>{item.content}</p>
      <button>DELETE</button>
    </div>)})
  );
}

export default Note;
